import styled from 'styled-components';
import Background from '../../assets/pattern1.svg';

const Container = styled.div`
  height:100vh;
  width: 100vw;
  background-image: url(${Background});
  background-size: 100%;
  position: relative;
  overflow: hidden;
`;


const TextTitle = styled.div`
  width: 265px;
  height: 52px;
  font-family: 'Work Sans'  ;
  font-size: 38px;
  font-weight: 500;
  font-style: normal;
  font-stretch: normal;
  line-height: normal;
  letter-spacing: normal;
  color: #e0c8ff;
  position: absolute;
  left: 632px;
  top: 80px;
  & > .textshadow {
    text-shadow: -20px -15px 1px rgba(224,200,255,0.1);
  }
  div:last-child{
    bottom: 0px;
    width: 128.8px;
    height: 1px;
    background-color: #c789ff;
    left: 24px;
    position: absolute;
    top: 54px;
  }
  & > .title {
    font-weight: 600
    span {
      font-wight: 300
    }
  }
`

const center = styled.div`
  display: flex;
  justify-content: center;
`

export {
  Container,
  TextTitle
}
